r($,"aB2","Qi",()=>A.b([A.w3("assets/images/social_network_background.jpg","One of the most remarkable advances in technology is the widespread use of mobile applications for communication and social interaction. Keeping this in mind, I am proud to introduce my mobile app, designed to bring people closer and create a platform for them to communicate and interact with each other.\n\nFeatures and Technology:\n\nThe app is designed for chatting, adding friends, and interacting with others just like a social network. It provides an easy and intuitive way to stay connected with friends and family, anywhere and anytime. To achieve this, the app has been built using the latest and most advanced technology, including Kotlin, the native language for android development, and Firebase, a cloud-based platform that provides robust tools and services for app development.\n\nConclusion:\n\nIn conclusion, my new mobile app is designed to provide a seamless and enjoyable experience for users looking to connect and interact with others. With the use of Kotlin and Firebase, it offers a powerful and versatile platform that is both robust and scalable. Whether you are looking to chat with friends, add new contacts, or simply interact with others, my app is the perfect solution for you.","","https://github.com/Hoangvu75/Chat-app","Social network","https://drive.google.com/file/d/1-KFMDq9XlgcSBRuY2Yddlg7ZzPhno_jF/view?usp=sharing"),A.w3("assets/images/chat_background.png","The world is becoming increasingly connected, and people are constantly seeking new and innovative ways to communicate and interact with one another. My chat app offers a new and exciting solution for real-time communication and interaction. The app is designed to allow users to chat, interact, contact, and video call with others in real-time, making it a great tool for staying connected with friends, family, and colleagues.\n\nOne of the key features of our chat app is its real-time functionality. Users can engage in conversations with one another in real-time, without any lag or delay. This feature makes our chat app a great choice for anyone looking to stay connected with others, whether it's for work or play.\n\nThe front-end of our chat app is written in Flutter, while the back-end is built with node.js, express, and mongodb. This combination of technologies provides a fast and reliable platform for real-time communication and interaction. Additionally, our app uses firebase to store images, ensuring that users' data is safe and secure.\n\nOverall, our chat app is a great solution for anyone looking for an easy and convenient way to stay connected with others. Whether you're looking to chat with friends, family, or colleagues, our app provides a fast and reliable platform for real-time communication and interaction.","","https://github.com/Hoangvu75/chatapp-flutter-frontend","Chat","https://drive.google.com/file/d/1AVF5pSkILjJNW3rvE2WMJGY-kEYjmlnd/view?usp=sharing"),A.w3("assets/images/movie_background.jpg","Movie lovers, brace yourself for the next-level movie experience with my brand new mobile application. With this app, you can now keep up with all the latest and popular movies. No more hassle of searching for the perfect movie to watch, this app has got you covered. From tracking down trending movies to searching for a particular movie, this app is the ultimate destination for movie enthusiasts. The app is created using the Flutter framework, making it visually appealing and user-friendly.\n\nFeatures:\n\nThe app is designed to cater to all your movie-related needs. Here are some of its key features:\n1. Trending Movies: The app keeps you updated with the latest trending movies, ensuring you never miss out on any popular releases.\n2. Movie Search: If you're looking for a specific movie, the app allows you to search for it with ease. Simply type in the movie's name, and you'll have all the relevant information at your fingertips.\n3. Movie Summary: The app provides a summary of each movie, giving you a brief overview of the story and characters. You can also view the cast, director, and other important details.\n\nTechnology and Architecture:\n\nThe app is created using Flutter, a modern framework for building high-performance, high-fidelity, apps for iOS and Android. Flutter allows for fast development and helps in creating visually appealing applications with ease.\nThe app follows the Model-View-ViewModel (MVVM) architectural design pattern. The Provider state management package is used to manage the data flow and update the UI. MVVM makes it easier to maintain and test the code, ensuring that the app is scalable and efficient.\n\nConclusion:\n\nIn conclusion, my movie app is the ultimate solution for movie lovers. With its user-friendly interface, comprehensive movie information, and up-to-date movie listings, this app is guaranteed to provide a seamless and enjoyable movie-watching experience. So, whether you're a fan of action, comedy, or romance, this app has got you covered. Download it now and get ready to dive into the world of movies.","","https://github.com/Hoangvu75/movie_app_flutter_mvvm","Movie app","https://drive.google.com/file/d/19yj-3DyX5i9WCPV_wBloDvfumAslVIXD/view?usp=sharing"),A.w3("assets/images/weather_background.jpg","I am proud to introduce a new weather app that is designed to keep you updated with the current weather conditions. This app is a must-have for all those who are curious about the weather in their area or any other place around the world.\n\nThe app is simple yet efficient in detecting the weather where you live. All you need to do is grant access to your location, and the app will automatically show you the current weather conditions. In addition, if you are interested in knowing the weather in another city, you can easily search for it in the app.\n\nThe app is designed using Kotlin and Java, two popular programming languages for native android app development. This ensures that the app is reliable, fast and user-friendly. Additionally, the app is built using the latest technologies to provide an exceptional user experience.\n\nThe app calls the weather data from Open Weather Map, one of the most reliable sources for weather data. This means that the weather information displayed on the app is accurate and up-to-date. You can trust the app to keep you informed about the weather conditions at all times.\n\nOverall, this weather app is the perfect solution for anyone who wants to stay informed about the weather in their area or any other place in the world. It is a must-have app for anyone who wants to be prepared for any weather conditions that may come their way.\n\nThank you for taking the time to read about my weather app. I hope that you find it useful and informative.","","https://github.com/Hoangvu75/Weather-forecast","Weather forecast","https://drive.google.com/file/d/1-7wVrpZ3W5J1n6Lf9GUFIFk2jDIPXCKN/view?usp=sharing"),A.w3("assets/images/techday_background.jpg","Techday 2022 is a purpose-built application designed specifically for FPT staff. It has been created to help FPT employees easily track events and anniversaries of the FPT Corporation. With the app, users can get information about FPT events and participate more easily.\n\nThe app is designed with a simple and user-friendly interface that makes it easy for users to find and access the information they need. The main feature of the app is the event calendar, which provides a comprehensive overview of all FPT events and anniversaries. The app also includes information about the event, such as the date, location, and a brief summary.\n\nAnother key feature of the Techday 2022 is its ability to provide real-time updates about events and anniversaries. This helps to ensure that users are always up-to-date with the latest information and can easily plan their participation in events.\n\nThe app has been written using Flutter, a popular open-source framework for building high-performance, high-fidelity, and beautiful applications for mobile, web, and desktop from a single codebase. Flutter provides a fast and smooth development experience, making it an ideal choice for creating a fast and responsive app like Techday 2022.\n\nIn conclusion, Techday 2022 is a valuable tool for FPT employees to help them stay informed about the latest events and anniversaries of the FPT Corporation. Its simple and intuitive design, combined with its real-time updates, make it the ideal app for anyone looking to participate in FPT events with ease.","https://play.google.com/store/apps/details?id=com.fpt.techday&hl=en_US&gl=US&pli=1","","Techday 2022",""),A.w3("assets/images/xinhxinh_background.png","In today's fast-paced world, the need for real-time communication and interaction has become an essential part of our daily lives. With the rise of technology, the creation of various applications to meet these needs has become an ongoing trend. One such application is Xinhxinh Livestream'. This app has been developed to cater to the needs of the customer, Xinhxinh Studio. The project is promoted and handled by the software team of FPT Telecom, and I am proud to have contributed as a mobile developer.\n\nFeatures:\n\na one-stop solution for users to interact and engage in real-time communication. The app provides users with the opportunity to livestream, advertise, and exchange (sell and buy) their production. The app has been written using Java core, which is a native android programming language.\n\nBenefits:\n\nThe app is user-friendly and has a simple interface that makes it easy for users to navigate and access the various features. This allows users to easily livestream their content, promote their production, and engage in real-time communication. Additionally, the app is also an efficient platform for users to exchange their production, as it provides a secure and convenient platform for transactions.\n\nConclusion:\n\nIn conclusion, Xinhxinh Livestream is an innovative app that provides users with the opportunity to interact, communicate, and exchange production in real-time. The app has been created using the latest technology, and is handled by a professional software team, ensuring that it is of the highest quality. I am proud to have contributed to this project and believe that the app will be of great benefit to its users.","https://play.google.com/store/apps/details?id=com.flive.xinhxinhlive&hl=vi","","XinhXinh Livestream","")],A.X("w<Gz>")))
